import React from "react";

const TerminalMainWindow = () => {
  return (
    <div>
      <p>Terminal Master</p>
      <div>
        <p>Drop your .xls file here</p>
        <p>or</p>
        <p>Browse File</p>
      </div>
      <div>
        <button className="btnPrimaryOutline">Cancel</button>
        <button className="btnPrimary">Submit</button>
      </div>
    </div>
  );
};

export default TerminalMainWindow;
